import React from 'react';
import { Menu } from 'antd';
const AppLayout = ({children}) => {
    return (
        <div>
            <Menu mode="horizontal">
                <Menu.Item key="home"><Link href="/class"><a>수업</a></Link></Menu.Item>
                <Menu.Item key="home"><Link href="/project"><a>과제</a></Link></Menu.Item>
                <Menu.Item key="home"><Link href="/group"><a>모둠</a></Link></Menu.Item>
                <Menu.Item key="home"><Link href="/setting"><a>관리</a></Link></Menu.Item>
            </Menu>
        </div>
    )
}
